import * as types from "./UserDataActionType";

export const loginUserEmail = (loginUserEmail) => {
  localStorage.setItem("loginUserEmail", JSON.stringify(loginUserEmail));
  return {
    type: types.GETUSEREMAIL,
    payload: loginUserEmail
  };
};
